import { NavLink } from 'react-router-dom';
import dialogsCSS from './Dialogs.module.css';


const DialogItem = (props) => {
    let path = '/dialogs/' + props.id;

    return <div className={dialogsCSS.dialog}>
    <NavLink to={path}>{props.name}</NavLink>
</div>
}


const MessageItem = (props) => {
    return <div className={dialogsCSS.message}>
    {props.message}
</div>
}


let data = 
{ 
    users : 
    [
        {
            id : 1,
            name : 'Name 1'
        },
        {
            id : 2,
            name : 'Name 2'
        },
        {
            id : 3,
            name : 'Name 3'
        },
        {
            id : 4,
            name : 'Name 4'
        },
        {
            id : 5,
            name : 'Name 5'
        },
        {
            id : 6,
            name : 'Name 6'
        }
    ]
}


const Dialogs = (props) => {
    let len = data.users.length - 1;

    return (
        <div className={dialogsCSS.dialogs}>
            <div className={dialogsCSS.dialogs_items}>
                {}
                

                <DialogItem name='Name 1' id='01'/>
                <DialogItem name='Name 2' id='02'/>
                <DialogItem name='Name 3' id='03'/>
                <DialogItem name='Name 4' id='04'/>
                <DialogItem name='Name 5' id='05'/>
                <DialogItem name='Name 6' id='06'/>
            </div>
            <div className={dialogsCSS.messages}>
                <MessageItem message='Message 1' />
                <MessageItem message='Message 2' />
                <MessageItem message='Message 3' />
                <MessageItem message='Message 4' />
                <MessageItem message='Message 5' />
                <MessageItem message='Message 6' />
            </div>
        </div>
    )
}


export default Dialogs;
